import React, { Component } from "react";
import styled from "styled-components";
import Hero from "./Components/Hero";
import Inputs from "./Components/Inputs";
import Table from "./Components/Table";
import BottomHero from "./Components/BottomHero";
import Footer from "./Components/Footer";
import "./App.css";

class App extends Component {
  constructor() {
      super();
      this.state = {
        testing: ""
}
this.passed_data_from_input = this.bind.passed_data_from_input(this)
}

  passed_data_from_input(data) {
    this.SetState({testing: data}, console.log(this.state.testing))
  }

  render() {
  const Div_App_main = styled.div`
    height: 1965px;
    width: auto;;
    overflow: hidden;
    `


    return (
    <Div_App_main>
     <Hero/>
     <button onClick={()=>{this.passed_data_from_input()}}>testing again</button>
     <Inputs passDatafromInputs={(data)=>{this.passed_data_from_input(data)}}/>
     <Table />
     <BottomHero/>
     <Footer/>
    </Div_App_main>
  )
  }
}

export default App;
